import React from 'react'
import auth0 from '../lib/auth0'

const App = () => {
  return (
    <h1>App</h1>
  )
}

export default App

export async function getServerSideProps({ req, res }) {
  const session = await auth0.getSession(req)
  if(session){
    return {
      props: {
        user: session.user
      }
    }
  }
  return {
    props: {
      user: {}
    }
  }
}
